  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { Playground, PropsTable } from 'docz';
import Footer from '../lib/footer';

const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"footer"}}>{`Footer`}</MDXTag>

<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`<Footer
    links={[
        { href: 'https://alegrify.com', title: 'Alegrify', label: 'Alegrify' },
        { href: 'https://google.com', title: 'Google', label: 'Google' },
    ]}
    logo={<span>üòç</span>}
>
    Some more content
</Footer>
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"properties"}}>{`Properties`}</MDXTag>
<PropsTable of={Footer} />
           </MDXTag>
  }
}
